import React, { Component ,Fragment} from 'react';
import store from './store/store.js'
class App extends Component {
  render() {
    return (
      <Fragment>
        <div>
          <input /><button>提交</button>
        </div>
        <div><ul><li>123</li></ul></div>
      </Fragment>
    );
  }
}

export default App;
